Steps to repro:
 * Create a non-empty DDB table with class Standard-IA
 * Log into CCS-System using creds mentioned in environment 
 * Click on the Sources in the left inventory and select source *893786004690*
 * Click on *DynamoDB* tab and click on *Hierarchy* view 
