column2078:
07/Jul/25 11:20 PM;dinesh.selvaraj;Backups were taken after upgrading the database to version 12.1
protection jobs:
TEST-DB2-11.5-RHEL9-FIafter upgrade
DB2-11.5_to_12.1_upgrade-RHEL9-FI
!Screenshot from 2025-06-27 11-42-15.png|thumbnail!

got below error during restore:
{code:java}
Error while fetching the restore details: [kFsError]: ERROR SCALEDB: javax.naming.CannotProceedException: Failed in restore, cause : Command [runuser, -l, db2inst1, -c, source /home/db2inst1/sqllib/db2profile ;db2 RESTORE DATABASE SCALEDB INCREMENTAL LOAD /opt/cohesity/db2/lib/libcohesity_db2.so OPEN 17 SESSIONS OPTIONS /opt/cohesity/db2/config/1751267958354#1751017734838 ON /home/db2inst1 INTO SCALEDB LOGTARGET /home/db2inst1/1751267958354/logtargetpath/SCALEDB NEWLOGPATH DEFAULT BUFFER 1024 WITHOUT PROMPTING ]failed with exit code: 4.. Stdout : SQL2547N The database was not restored because the backup image is from a previous release and requires rollforward recovery. {code}

As discussed with Ravi Sagar, I am starting from scratch because I initially created a separate job after upgrading the database. However, the requirement is to use the same job for taking backups. ;;;

column2079:
07/Jul/25 11:24 PM;dinesh.selvaraj;As discussed, I attempted to run the incremental backup first after upgrading the database, but I encountered the following error
{code:java}
ERROR SCALEDB: javax.naming.CannotProceedException: WARN : Not allowed to convert current run to full backup for SCALEDB , pass valid flag to convert current run to full backup {code}
So I proceed with the full backup first

Snapshot restore and PITR restore to the original location were successful.
Snapshot restore to the new location (another VM) failed with the following error.
{code:java}
Error while fetching the restore details: [kFsError]: ERROR SCALEDB: javax.naming.CannotProceedException: Failed in restore, cause : Command [runuser, -l, db2inst1, -c, source /home/db2inst1/sqllib/db2profile ;db2 RESTORE DATABASE SCALEDB INCREMENTAL LOAD /opt/cohesity/db2/lib/libcohesity_db2.so OPEN 17 SESSIONS OPTIONS /opt/cohesity/db2/config/1751348495669#1751346059036 ON /home/db2inst1 INTO TESTDB1 LOGTARGET /home/db2inst1/1751348495669/logtargetpath/TESTDB1 NEWLOGPATH DEFAULT BUFFER 1024 WITHOUT PROMPTING ]failed with exit code: 4.. Stdout : SQL2514N The RESTORE was not successful. The backup used to restore the database is not compatible with the installed database manager. {code}

In the above case, I used a 12.1 snapshot to restore to a new location, which failed.
I then attempted the same operation using an 11.5 snapshot, and the restore to the new location was successful.
*Note:* The database on the new location VM is version 11.5;;;

