Issue on 6.8.2_u1, 7.1.2_u4 and 7.2.2_u1:

{code}

Linux agent installation is failing on RHEL 10.0 with error "cp: cannot create regular file '/etc/init.d/cohesity-agent': No such file or directory"

On further investigation, We found that /etc/init.d folder is missing in RHEL 10

{code}

Issue on master:

{code}

Linux agent installation is failing on RHEL 10.0 with error "Error: systemctl start cohesity-agent.service failed"

On further investigation, We found that Its automatically creating the /etc/init.d folder and cohesity agent service is running.

{code}

{*}Note{*}: Attached the recording for reference

