column2077:
25/Jun/25 1:35 AM;rohit.kantimahanty;I noticed

- There is check in each pod to monitor the process running inside and if it is not, restart the pod. This is like a failover mechanism and causing the pod to restart as service is not up. But why the service is not up?

- The process running in the pod is getting killed because of OOM
{noformat}
[Tue Jun 24 03:58:20 2025] C2 CompilerThre invoked oom-killer: gfp_mask=0xcc0(GFP_KERNEL), order=0, oom_score_adj=-997 [Tue Jun 24 03:58:20 2025] oom_kill_process.cold+0xb/0x10 [Tue Jun 24 03:58:20 2025] oom-kill:constraint=CONSTRAINT_MEMCG,nodemask=(null),cpuset=cri-containerd-98501f224784b1e93990464ce3e8ed2e7847434f942b29b6474f2655cf52cd04.scope,mems_allowed=0,oom_memcg=/kubepods.slice/kubepods-pod6146d6e8_8459_457d_a180_fa8f789ae8b2.slice,task_memcg=/kubepods.slice/kubepods-pod6146d6e8_8459_457d_a180_fa8f789ae8b2.slice/cri-containerd-98501f224784b1e93990464ce3e8ed2e7847434f942b29b6474f2655cf52cd04.scope,task=jsvc,pid=2215182,uid=1000 [Tue Jun 24 03:58:20 2025] Memory cgroup out of memory: Killed process 2215182 (jsvc) total-vm:4290704kB, anon-rss:382804kB, file-rss:36720kB, shmem-rss:0kB, UID:1000 pgtables:1064kB oom_score_adj:-997{noformat}

*As we have run the TCs in the past with same resources given to the API server, needs to investing what is causing the pod to get into OOM state.*
cc: [~Sudarshan.Bhat] [~jishnu.jayasree] ;;;

