column2077:
27/Jun/25 1:32 AM;ayush.agrawal;Cluster mentioned above uses old vdi ops.
SqlVDIBackupSubTaskOp
In this op, we have below code which only allows progress monitor for file based log backup jobs.
{code:java}
  // We will use db level monitor if we are being forced to use it (when
  // reporting progress), or if this is a db level full backup.
  const bool use_db_level_monitor =
      force_db_level_monitor ||
      (arg_->has_env_backup_params() &&
       sql::IsFileBasedSqlFullJob(arg_->env_backup_params()));

  if (use_db_level_monitor) {
    return GetLogBackupProgressMonitorPathForDb(ProgressMonitorRootPath(),
                                                sql_id);
  }
{code}
Tested the same scenarios with latest clusters which use 
SqlNativeFullBackupSubTaskOp and has updated code and shows pulse monitor properly.
{code:java}
  const bool is_log_backup = arg_->backup_type() == ScheduledBackupType::kLog;

  return is_log_backup ? GetLogBackupProgressMonitorPathForDb(
                             ProgressMonitorRootPath(), sql_id)
                       : GetNativeBackupProgressMonitorPathForDb(
                             ProgressMonitorRootPath(), sql_id);

  return ProgressMonitorRootPath(); {code}
This cr: [https://gerrit.eng.cohesity.com/c/main/+/539789] fixed the same issue for native op.

cc: [~durgesh.kumar.verma] [~yuvanesh.natarajan] ;;;

