{code:java}
// First check whether we have valid numeric versions. if (agent_ver.empty() ||cluster_ver.empty()) { VLOG(1) <<"Agent is not upgradable because we are missing version " "information. cluster=" << cluster_sw_version <<", agent="<< agent_sw_version; entity->mutable_properties()->set_upgradability( agent::Properties::kNonUpgradableInvalidVersion); return; }{code}
Hi [~riswana.shagul] this agent upgrade from master agent ver is not supported as per the code above. The upgradability is only shown for numbered branches which are actual release branches. If you have to have the upgradability for some testing, please use the gflag 
FLAGS_magneto_master_agent_sw_set_force_upgradable for testing purposes.

Closing this now.

